import store from '../store'

export default {
  alert(msg, callback) {
    store.commit('dialog/setDialog', {
      message: msg,
      type: 'alert',
      callback: callback || null
    })
  },
  confirm(msg, callback) {
    store.commit('dialog/setDialog', {
      message: msg,
      type: 'confirm',
      callback: callback || null
    })
  },
  toast(msg, callback) {
    store.commit('dialog/setDialog', {
      message: msg,
      type: 'tips',
      callback: callback || null
    })
  }
}
